import React from "react";
import "./styles/App.css";
import Form from "./components/Form";
import Header from "./components/Header";

const userIsRegistered = false;

function App() {
  return (
    <div className="container">
      <Header />
      <Form isRegistered={userIsRegistered} />
    </div>
  );
}

export default App;
